import React from "react";
import ReactDOM from "react-dom";

const name = "Jatin Thakur";
const img1 = "https://picsum.photos/200/300";

ReactDOM.render(
   <>
   <h1 contentEditable="true"> My Name Is {name} </h1>
   <img src= {img1}
   alt="randomimages"/> 
  </> ,
   document.getElementById("root"));
